import ReorderIcon from "@mui/icons-material/Reorder";
const Header = () => {
  return (
    <div>
      <div>
        <ReorderIcon></ReorderIcon>
        <img
          src="https://www.logo.wine/a/logo/Gmail/Gmail-Logo.wine.svg"
          alt="logo"
        ></img>
      </div>
    </div>
  );
};

export default Header;
